import React, {useState} from 'react';
import Lab from './Lab'
import {Grid } from '@mui/material'
import { makeStyles } from '@material-ui/core'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CardActionArea from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import FeasibilityItem from './FeasibilityItem';
let mockups = [
  {
    name: 'Chat Function',
    date: '',
    description: 'Flow chart of each step of a student major choice and job employment with identified problems',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  },
  {
    name: "Career Picker",
    date: '',
    description: 'Flow Chart of student education with identified solutions',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  },
  {
    name: "Job Board",
    date: '',
    description: 'Flow Chart of student education with identified solutions',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  },
  {
    name: "Cost Estimator",
    date: '',
    description: 'Flow Chart of student education with identified solutions',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  }
]

let planning = [
  {
    name: 'Prototype Planning Presentation',
    date: '',
    description: 'Flow chart of each step of a student major choice and job employment with identified problems',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  },
  {
    name: "Sprint Plan",
    date: '',
    description: 'Flow Chart of student education with identified solutions',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  }
]
let features = [
  {
    name: 'Societal Presentation',
    date: '2022-09-21',
    description: 'Original Idea Pitch by Austin Fitzhugh',
    link: '',
    img: ''
  },
  {
    name: "Feasibility Presentation",
    date: '',
    description: 'Version 1',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  }
]
let weeklydevelopmentreports = [
  {
    name: "Major Functional Components",
    date: '',
    description: 'Flow Chart of major components of the app',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  },
  {
    name: "Competition Matrix",
    date: '',
    description: 'Matrix comparing features between our app and competitors',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  }
]

let finaldemonstration = [
  {
    name: "Major Functional Components",
    date: '',
    description: 'Flow Chart of major components of the app',
    link: '',
    img: '../documents/ProblemFlowComplete.png',
  }]
const Prototype = () => {

  return (
    <div>
      <div id="mockups">
    <Typography variant='h3'>
  Mockups
</Typography>
<Divider>
</Divider>
  <Grid container spacing={2}>
{mockups.map((diagram) => {
return (
  <Grid item xs={12} sm={6} md={4}>
    <FeasibilityItem key={diagram.name} lab={diagram} />
  </Grid>
)
})}
</Grid>
</div>
<br></br>
      <div id="planning">
              <Typography variant='h3'>
            Planning
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {planning.map((diagram) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <FeasibilityItem key={diagram.name} lab={diagram} />
            </Grid>
          )
          })}
      </Grid>
      </div>
      <br></br>
      <div id="features">
              <Typography variant='h3'>
            Features
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {features.map((diagram) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <FeasibilityItem key={diagram.name} lab={diagram} />
            </Grid>
          )
          })}
      </Grid>
      </div>
      <div id="weeklydevelopmentreports">
              <Typography variant='h3'>
            Weekly Development Reports
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {weeklydevelopmentreports.map((diagram) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <FeasibilityItem key={diagram.name} lab={diagram} />
            </Grid>
          )
          })}
      </Grid>
      </div>
      <div id="finaldemonstration">
              <Typography variant='h3'>
            Final Demonstration
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {finaldemonstration.map((diagram) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <FeasibilityItem key={diagram.name} lab={diagram} />
            </Grid>
          )
          })}
      </Grid>
      </div>
    </div>
  )
}

export default Prototype
